import { Wrapper } from "./Header.styles";

import { Logout }  from "../components/auth/Logout";

const Header = () => {
    return (
    <Wrapper>

      <nav class="navbar sticky-top">
        <a class="navbar-brand" href="">Scart</a>
        
        <div>
              { isAuthenticated &&  <Logout />}
                 
              </div>
      </nav>
    </Wrapper>
  
 );
};

export default Header;
